  return (
    <div className={className}>
      <Image
        src="/ad-image.png"
        layout="fill"
      />
    </div>
  )
}


Ads = styled(Ads)`
  box-shadow: var(--shadow-sm);  
  width: 100%;
`

export default  Ads
